<!DOCTYPE html>
<style>@import url(/style.css);</style>
<body class="O--body">
<div id="one"></div>
<div id="two"></div>
<div id="three"></div>
<script src="/build/notebook-runtime.js"></script>
<script>

var runtime = O.runtime(),
    module = runtime.module();

module.variable("#one").define("foo", 1);
module.variable("#two").define("foo", 2);
module.variable("#three").define(["foo"], foo => foo);

</script>
